import Home from "../components/home";
import NotFound from "../modules/notFound";
import AboutUs from "../components/aboutus";
import Single from "../components/blog/Single";



// then our route config
const routes = [
  {
      path: '/home',
      component: Home,
  },
  {
    path: '/aboutus',
    component: AboutUs
  },
  {
    path: '/blog-posts/:id',
    component: Single
  },
  {
      path: '/',
      component: Home,
      exact: true,
  },
  {
      path: '*',
      component: NotFound,
  }
];

export default routes;
